define('signpop',['jquery', 'sweetalert'], function($, Swal) {
  var num = 0,
    max = 60,
    timeres
  //没时间检查了，太麻烦
  function timecheck() {
    ++num < max && ((timeres = setTimeout(timecheck, 1e3)), weauth_check())
  }
  function weauth_auto_login(ssk, mail) {
    ajax.post(Mtx.ajax_url, 'action=weauth_oauth_login&spam=' + ssk + (mail ? '&email=' + mail : ''), function(result) {
      location.reload()
    })
  }
  function weauth_check() {
    var ssk = document.getElementById('ssk').innerHTML
    if (ssk != null && ssk != 0) {
      ajax.post(Mtx.ajax_url, 'action=weauth_check&sk=' + ssk, function(id) {
        if (id != 0) {
          clearTimeout(timeres)
          weauth_auto_login(id)
        }
      })
    }
  }
  function getCaptchaSrc() {
    return Mtx.url + '/action/captcha.php?' + new Date().getTime()
  }
  function qr_gen() {
    ajax.post(Mtx.ajax_url, 'action=weauth_qr_gen', function(result) {
      var t = result.split('|'),
        e = document.getElementById('open-auth'),
        a = document.getElementById('ssk')
      a.innerHTML = t[0]
      e.innerHTML = '<img id="weaqr" style="width:300px;height:300px" src=' + t[1].replace('&quot;', '') + '>'
    })
  }
  return {
    weauth_check: function() {
       if (getCookie('bind') == 1) return

      Swal.fire({
        title: '绑定邮箱',
        text: '为了方便使用邮箱登录，我们墙裂推荐您绑定邮箱',
        icon: 'warning',
        showCancelButton: true,
        confirmButtonColor: '#3085d6',
        cancelButtonColor: '#d33',
        confirmButtonText: '绑定',
        cancelButtonText: '暂时不用'
      }).then(result => {
        if (result.value) {
          Swal.fire({
            title: '输入你的邮箱',
            input: 'text',
            inputAttributes: {
              autocapitalize: 'off'
            },
            showCancelButton: false,
            confirmButtonText: '绑定',
            showLoaderOnConfirm: true,
            preConfirm: login => {
              return fetch(Mtx.ajax_url, {
                method: 'POST',
                body: 'action=bind_email_check&email=' + login,
                headers: {
                  'Content-Type': 'application/x-www-form-urlencoded'
                }
              })
                .then(response => {
                  if (!response.ok) {
                    throw new Error(response.statusText)
                  }
                  return response.json()
                })
                .catch(error => {
                  Swal.showValidationMessage(`Request failed: ${error}`)
                })
            },
            allowOutsideClick: () => !Swal.isLoading()
          }).then(result => {
            if (result.c != 1) {
              Swal.fire('邮箱绑定失败!', '您输入的邮箱已被绑定或者邮箱格式不正确!', {
                icon: 'error',
                dangerMode: true
              })
            } else {
              Swal.fire({
                title: '邮箱绑定成功',
                text: '绑定成功!',
                icon: 'success'
              }).then(() => {
                location.reload()
              })
            }
          })
        }
      })
    },

    init: function() {
      $(function() {
        requirejs(['fancybox'], function() {
          $('.fancy-sign').fancybox({
            touch: false
          })
        })

        //微信登录开始
        $('.wx_openid').on('click', function() {
          $.fancybox.open({
            src: '<div id="open-auth"></div><span style="display:none" id="ssk"></span>',
            type: 'html',
            opts: {
              afterClose: function(instance, slide) {
                clearTimeout(timeres)
              }
            }
          })
          qr_gen()
          timeres = setTimeout(timecheck, 1e3)
        })
        //微信登录结束

        //点击刷新验证码
        $('.captcha-img').on('click', function() {
          $(this).attr('src', getCaptchaSrc())
        })

        //切换栏目
        $('.signin-loader').on('click', function() {
          $('#sign-in').show()
          $('#sign-up').hide()
          $('#sign-in img').attr('src', getCaptchaSrc())
        })

        $('.signup-loader').on('click', function() {
          $('#sign-up').show()
          $('#sign-in').hide()
          $('#sign-up img').attr('src', getCaptchaSrc())
        })

        //支持回车
        $('.sign form').keydown(function(e) {
          var e = e || event,
            keycode = e.which || e.keyCode
          if (keycode == 13) {
            $(this)
              .find('.signsubmit-loader')
              .trigger('click')
          }
        })

        $('.signsubmit-loader').on('click', function() {
          if (Mtx.is_signin) return

          var form = $(this)
            .parent()
            .parent()
          var inputs = form.serializeObject()
          var isreg = inputs.action == 'signup' ? true : false

          if (!inputs.action) {
            return
          }

          if (isreg) {
            if (!Mtx.is_mail(inputs.email)) {
              logtips('邮箱格式错误')
              return
            }

            //支持中文
            if (!/^[a-zA-Z\d_]{3,20}$/.test(inputs.name)) {
              logtips('昵称是以字母数字下划线组合的3-20位字符')
              return
            }
          } else {
            if (inputs.password.length < 6) {
              logtips('密码太短，至少6位')
              return
            }
          }

          $.ajax({
            type: 'POST',
            url: Mtx.url + '/action/log.php',
            data: inputs,
            dataType: 'json',
            success: function(data) {
              if (data.msg) {
                logtips(data.msg)
              }
              if (data.error) {
                return
              }
              if (!isreg) {
                location.reload()
              } else {
                if (data.goto) location.href = data.goto
              }
            }
          })
        })

        var _loginTipstimer
        function logtips(str) {
          if (!str) return false
          _loginTipstimer && clearTimeout(_loginTipstimer)
          $('.sign-tips')
            .html(str)
            .animate(
              {
                height: 29
              },
              220
            )
          _loginTipstimer = setTimeout(function() {
            $('.sign-tips').animate(
              {
                height: 0
              },
              220
            )
          }, 5000)
        }
      })
    }
  }
})
;
